"""
Given a string, find the length of the longest substring without repeating characters.

Example 1:
    Input: "abcabcbb"
    Output: 3
    Explanation: The answer is "abc", with the length of 3.

Example 2:
    Input: "bbbbb"
    Output: 1
    Explanation: The answer is "b", with the length of 1.

Example 3:
    Input: "pwwkew"
    Output: 3
    Explanation: The answer is "wke", with the length of 3.
    Note that the answer must be a substring, "pwke" is a subsequence and not a substring.
"""

def lengthOfLongestSubstring(s):
    l = len(s)  # length of the input string
    max_l = 0  # record the maximum length of substring without repeating characters
    start_index = 0  # the start point of substring
    chars_index = dict()  # record the index of the chars in substring

    # iterate over the input string
    for i in range(l):
        # check if the char already in the substring
        if s[i] not in chars_index:
            chars_index[s[i]] = i  # store its index into dict
            if i - start_index + 1 > max_l:  # update the maximum length
                max_l = i - start_index + 1
        else:
            # if this char already in chars_index dict, find its last index in string s
            last_same_char_index = chars_index[s[i]]
            # remove the keys from dict which in front of the last same char in substring
            for char in s[start_index:last_same_char_index]:
                del chars_index[char]
            # update the index of this char in dict
            chars_index[s[i]] = i
            # update the star point of the substring
            start_index = last_same_char_index + 1

    return max_l


# instead of deleting the old num which is not in substring from dict, for each num,
# this method will store all of the indexs into a list
def lengthOfLongestSubstring2(s):
    l = len(s)  # length of the input string
    max_l = 0  # record the maximum length of substring without repeating characters
    start_index = 0  # the start point of substring
    chars_index = dict()  # record the index of the chars in substring

    # iterate over the input string
    for i in range(l):
        # check if the char already in the substring
        if s[i] not in chars_index:
            chars_index[s[i]] = [i]  # store its index into dict
            if i - start_index + 1 > max_l:  # update the maximum length
                max_l = i - start_index + 1
        else:
            # if the last same num is in front of the start point
            if chars_index[s[i]][-1] < start_index:
                if i - start_index + 1 > max_l:  # update the maximum length
                    max_l = i - start_index + 1
            else:
                # if this char already in chars_index dict, find its last index in string s
                last_same_char_index = chars_index[s[i]][-1]
                # update the star point of the substring
                start_index = last_same_char_index + 1
            chars_index[s[i]].append(i)

    return max_l



